@import 'base';
.container {
    @extend .flex-column-center;
    align-items: center;
    justify-content: flex-start;
    height: 100%;
    width: 100%;
    font-weight: 400;
    padding-top: 1.5rem;
}
.panel {
    @extend .flex-column-center;
    justify-content: center;
    padding: 1.25rem;
    width: 35%;
