        width: 75%;
    }
    min-width: 250px;
    min-height: 270px;
}
.or {
    margin-top: 1rem;
    margin-bottom: .5rem;
    font-size: 1.3rem;
}
.signup {
    @extend .flex-column-center;
    justify-content: center;
    margin-top: 2rem;
    &Link {
        color: $linkBlue;;
        font-size: 1.2rem;
        &:hover {
            color: $materialBlue;;
        }
    }
    &Label {
        font-size: 1.3rem;
        font-size: 1rem;
        font-weight: bold;
        color: $mediumGray;
        font-weight: 400;
    }
}
